css:
.git-blame-mount {
  position: relative;
}
.git-blame-mount .git-blame .git-blame-resize-handle {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: auto;
  width: 10px;
  cursor: col-resize;
  z-index: 1;
}
.git-blame-mount .git-blame .git-blame-scroller {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  overflow: hidden;
  background-color: #292c2f;
  border-right: 1px solid rgba(0, 0, 0, 0.5);
  border-left: 1px solid rgba(0, 0, 0, 0.5);
}
.git-blame-mount .git-blame .git-blame-scroller .blame-lines {
  padding-bottom: 30px;
  white-space: nowrap;
}
.git-blame-mount .git-blame .git-blame-scroller .blame-lines .blame-line {
  padding-left: 4px;
  overflow: hidden;
  text-overflow: ellipsis;
}
.git-blame-mount .git-blame .git-blame-scroller .blame-lines .blame-line.line-bg-lighter {
  background-color: #323639;
}
.git-blame-mount .git-blame .git-blame-scroller .blame-lines .blame-line.line-bg-darker {
  background-color: #1f2224;
}
.git-blame-mount .git-blame .git-blame-scroller .blame-lines .blame-line .hash,
.git-blame-mount .git-blame .git-blame-scroller .blame-lines .blame-line .date {
  font-size: 90%;
  padding-right: 10px;
}
.git-blame-mount .git-blame .git-blame-scroller .blame-lines .blame-line.no-commit .committer,
.git-blame-mount .git-blame .git-blame-scroller .blame-lines .blame-line.no-commit .date {
  display: none;
}
